																													  5,
																													  'Master Python by building 100 projects in 100 days. Learn data science, automation, build websites, games and apps!',
																													'Master the Python programming language by building 100 unique projects over 100 days!Learn automation, game, app and web development, data science and machine learning all using Python!Be able to program in Python professionally!Be able to build fully fledged websites and web apps with Python',
																													 'No programming experience needed - I''ll teach you everything you need to know!A Mac or PC computer with access to the internet!No paid software required - I''ll teach you how to use PyCharm, Jupyter Notebooks and Google Colab!I''ll walk you through, step-by-step how to get all the software installed and set up',
																													'<p>Welcome to the 100 Days of Code - The Complete Python Pro Bootcamp,<strong>&nbsp;the only course you need</strong>&nbsp;to learn to code with Python. With over 500,000&nbsp;<strong>5 STAR reviews</strong>&nbsp;and a 4.8 average, my courses are some of the HIGHEST&nbsp;RATED courses in the history of Udemy!&nbsp;&nbsp;</p><p><strong>100 days, 1 hour per day, learn to build 1 project per day, this is how you master Python.</strong></p><p>At 60+ hours, this Python course is without a doubt the&nbsp;<strong>most comprehensive&nbsp;</strong>Python course available anywhere online. Even if you have&nbsp;<strong>zero</strong>&nbsp;programming experience, this course will take you from&nbsp;<strong>beginner to professional</strong>. Here''s why:</p><ul><li><p>The course is taught by the&nbsp;<strong>lead instructor</strong>&nbsp;at the App Brewery, London''s&nbsp;<strong>best in-person programming Bootcamp</strong>.</p></li><li><p>The course has been updated to be&nbsp;<strong>2023 ready&nbsp;</strong>and you''ll be learning the latest tools and technologies used at large companies such as Apple, Google and Netflix.</p></li><li><p>This course doesn''t cut any corners, there are beautiful&nbsp;<strong>animated explanation videos</strong>&nbsp;and tens of&nbsp;<strong>real-world projects</strong>&nbsp;which you will get to build. e.g. Tinder auto swiper, Snake game, Blog Website, LinkedIn Auto Submit Job Application</p></li><li><p>The curriculum was developed over a period of<strong>&nbsp;2 years</strong>, with comprehensive student testing and feedback.</p></li><li><p>We''ve taught over 600,000 students how to code and many have gone on to&nbsp;<strong>change their lives&nbsp;</strong>by becoming professional developers or starting their own tech startup.</p></li><li><p>You''ll save yourself&nbsp;<strong>over $12,000&nbsp;</strong>by enrolling, and still get access to the same teaching materials and learn from the same instructor and curriculum as our in-person programming Bootcamp.</p></li><li><p>The course is&nbsp;<strong>constantly updated</strong>&nbsp;with new content, with new projects and modules determined by students - that''s you!</p></li></ul><p>&nbsp;</p><p>We''ll take you&nbsp;<strong>step-by-step</strong>&nbsp;through engaging video tutorials and teach you everything you need to know to succeed as a Python developer.</p><p>The course includes over&nbsp;<strong>65 hours</strong>&nbsp;of HD video tutorials and builds your programming knowledge while making real-world Python projects.</p>',
