																												   4,
																												   'Mastering High Level System Design Interview | Software Architecture case studies | Design patterns | Microservices',
																												   'Strategy to crack your next High Level System Design Interview!Learn about Distributed Sytems, Microservices Architecture, Databases, Software Architecture, Analytics, and Design Patterns!Solutions to the most common Interview Questions at FAANGs!Become an expert at High Level System Design!Set yourself up for success with quizzes and coding problems',
																												   'Prerequisites are basic knowledge of Computer science, but this course is ideally meant for people who are planning on giving Software Engineering interviews, and want to get a quick crash course on System Design before the real interview.',
																												   '<p>Are you preparing for a&nbsp;<strong>System Design interview</strong>? Do you want to learn the best practices and techniques for designing scalable and distributed systems? Look no further!</p><p>Our course on System Design is designed to give you a comprehensive understanding of key concepts and frameworks to help you&nbsp;<strong>ace your interview&nbsp;</strong>and excel in your career.</p><p>&nbsp;</p><p>You should go through this course in five scenarios:</p><ol><li><p>If you have a&nbsp;<strong>System Design interview</strong>&nbsp;coming up and want a quick crash course.</p></li><li><p>To learn about Software Architecture, Data modeling, Distributed systems, Databases, Microservices based architecture, and Cloud architecture.</p></li><li><p>If you are designing a new system at work, and want to make sure you get it right.</p></li><li><p>If you want to look at some case studies of how some of FAANGs and other companies have built their systems.</p></li><li><p>Look at solutions to some of the most common&nbsp;<strong>Interview questions</strong></p></li></ol><p>As part of this course, we''ll go through some of the conceptual things, some do''s and don''ts, and most importantly we''ll be looking at some of the biggest systems out there and how you could design those. There is a good probability that your next interview has one of these questions either exactly, or with some small variation.</p>',
