																													3,
																													'Master Angular (formerly "Angular 2") and build awesome, reactive web apps with the successor of Angular.js',
																													'Develop modern, complex, responsive and scalable web applications with Angular!Fully understand the architecture behind an Angular application and how to use it!Use the gained, deep understanding of the Angular fundamentals to quickly establish yourself as a frontend developer!Create single-page applications with one of the most modern JavaScript frameworks out there',
																													'NO Angular 1 or Angular 2+ knowledge is required!Basic HTML and CSS knowledge helps, but isn''t a must-have!Prior TypeScript knowledge also helps but isn''t necessary to benefit from this course!Basic JavaScript knowledge is required',
																													'<p><strong>Join the most comprehensive and bestselling Angular course on Udemy and learn all about this amazing framework from the ground up, in great depth!</strong></p><p><strong>This course starts from scratch, you neither need to know Angular 1 nor Angular 2!</strong></p><p>From&nbsp;<strong>Setup</strong>&nbsp;to&nbsp;<strong>Deployment</strong>, this course covers it all! You''ll learn all about&nbsp;<strong>Components</strong>,&nbsp;<strong>Directives</strong>,&nbsp;<strong>Services</strong>,&nbsp;<strong>Forms</strong>,&nbsp;<strong>Http</strong>&nbsp;Access,&nbsp;<strong>Authentication, Optimizing an Angular&nbsp;App with Modules and Offline Compilation</strong>&nbsp;and&nbsp;<strong>much more&nbsp;</strong>- and in the end:&nbsp;You''ll learn how to&nbsp;<strong>deploy</strong>&nbsp;<strong>an application</strong>!</p><p><strong>But that''s not all!</strong>&nbsp;This course will also show you how to use the&nbsp;<strong>Angular&nbsp;CLI</strong>&nbsp;and feature a&nbsp;<strong>complete project</strong>, which allows you to practice the things learned throughout the course!</p><p>And if you do get stuck, you&nbsp;<strong>benefit from an extremely fast and friendly support</strong>&nbsp;- both via direct messaging or discussion. You have my word!&nbsp;;-)</p><p>Angular is one of the most modern, performance-efficient and powerful frontend frameworks you can learn as of today. It allows you to build great web apps which offer awesome user experiences!<strong>&nbsp;Learn all the fundamentals you need to know to get started developing Angular&nbsp;applications right away.</strong></p>',
