																												   '机器学习 A-Z (Machine Learning A-Z in Chinese)',
																												   7,
																												   '全面建立机器学习的知识架构，并且在Python和R里构建不同的机器学习模型。课程内容包括所有的代码模板',
																												   '利用机器学习创造更多价值!深刻理解各种机器学习的模型!做出准确的预测和强大的分析!利用机器学习创造更多价值!利用机器学习解决私人问题!掌握并熟练处理强大的算法，例如强化学习，自然语言处理，还有深度学习',
																													'高中数学知识即可',
																													'<p>想了解机器学习？这门课程为您订做！</p><p>这门课程是英文课程Machine Learning A-Z的翻译和再创造。原版英文课程是Udemy上最畅销的机器学习课程。您在这门课里，会用深入浅出的方法学会复杂的模型，算法，还有基础的编程语句。</p><p>我们会手把手地教会您机器学习。每一节课都会让您获得新的知识，完备机器学习的知识架构，在享受机器学习的同时对这个领域有更深的理解。</p><p>这门课程十分有趣，包含了机器学习的方方面面。课程结构如下：</p><ul><li>第一部分 -&nbsp;数据预处理</li><li>第二部分&nbsp;-&nbsp;回归：简单线性回归，多元线性回归，多项式回归</li><li>第三部分&nbsp;-&nbsp;分类：逻辑回归，支持向量机（SVM），核函数与支持向量机（Kernel SVM），朴素贝叶斯，决策树分类，随机森林分类</li><li>第四部分&nbsp;-&nbsp;聚类：K-平均聚类分析</li><li>第五部分&nbsp;-&nbsp;关联规则学习：先验算法</li><li>第六部分 (待更新)&nbsp;-&nbsp;强化学习：置信区间上界算法（UCB），Thompson抽样算法</li><li>第七部分&nbsp;(待更新)&nbsp;-&nbsp;自然语言处理&nbsp;：自然语言处理算法</li><li>第八部分&nbsp;(待更新)&nbsp;-&nbsp;深度学习：人工神经网络，卷积神经网络</li><li>第九部分&nbsp;(待更新)&nbsp;-&nbsp;降维（Dimensionality Reduction）：主成分分析 （PCA），核函数主成分分析（Kernel PCA）</li><li>第十部分&nbsp;(待更新)&nbsp;-&nbsp;模型选择：模型选择，极端梯度上升</li></ul><p>对于每个模型，除了学会理论基础之外，您还会学习如何将这些模型运用到各种实际生活的案例里，并且课程也包括Python和R的代码模板，您可以下载并且直接将代码运用到您自己的项目里。</p>',
