																												   'Learn DevOps: CI/CD with Jenkins using Pipelines and Docker',
																												   8,
																												   'Use Jenkins the DevOps way. Automate your Jenkins jobs by using Jenkins Pipelines, Docker, and the Jenkins Job DSL',
																												   'Use Jenkins to perform Continuous Integration within your Software Development Lifecycle!Configure Jenkins “The DevOps way”, using Docker, Jobs DSL and Jenkins Pipelines!Configure the authentication and authorization options to tighten security on your Jenkins UI!Use plugins to integrate Jenkins with popular development software',
																													'You should have an understanding about software development in general!You''ll need to be able to install Jenkins on a PC or Cloud instance.',
																													'<p><strong>Jenkins is the most popular tool</strong> to do&nbsp;<strong>Continuous Integration</strong>and&nbsp;<strong>Continuous Delivery</strong> of your software:</p><ul><li><p>It&rsquo;s&nbsp;<strong>free and open source</strong></p></li><li><p>It has a&nbsp;<strong>strong community</strong> with thousands of plugins you can use</p></li><li><p>Jenkins is used in a lot of companies, from&nbsp;<strong>startups</strong> to&nbsp;<strong>enterprises</strong></p></li></ul><p>This course will teach you how to use Jenkins using the Jenkins DSL and Jenkins Pipelines (Jenkinsfile). It&apos;s a new way of using Jenkins, rather than using freestyle projects. I call it using Jenkins,&nbsp;<strong>the DevOps way</strong>! I&apos;ll explain you about infrastructure as code and automation to make sure you understand how Jenkins Pipelines fits within this new way of thinking.&nbsp;</p><p>I&apos;ll show you how to integrate Jenkins Pipelines with popular software tools, like:</p><ul><li><p>Docker</p></li><li><p>GitHub /&nbsp;Bitbucket</p></li><li><p>JFrog Artifactory</p></li><li><p>SonarQube</p></li><li><p>Onelogin (Using SAML)</p></li></ul><p>If you&rsquo;re looking for a job in the&nbsp;<strong>DevOps</strong> <strong>space</strong>, Jenkins is a must have skill.</p><p>I explain in the course how to install Jenkins if you don&apos;t have an installed version yet. You&apos;ll need a Ubuntu 20.04.x VM or cloud instance to follow the installation procedure. In the demos I will be using DigitalOcean as a cloud provider, but you are free to use any provider or VM (VMWare/Virtualbox, AWS, Azure, Google Cloud, etc). I&apos;ll be assisting you in the Q&amp;A if you have any problems setting up Jenkins.</p>',
