																												   'NodeJS 后端编程语言入门',
																												   9,
																												   '通过实践练习和项目，学习成为Node.js开发人员所需的一切',
																												   '掌握NodeJS如何工作的原理!理解NodeJS背后的Javascript和技术概念!在Node中构建一个Web服务器，并了解它是如何工作的!使用Express更轻松地构建Web应用程序和API!连接到Node中的SQL或Mongo数据库!还有很多.......',
																													'对JavaScript的基本理解!对html,css的基本理解!简单的命令行操作',
																													'<p>Node.js是目前最流行的技术，Node&nbsp;开发人员是该行业中收入最高的。</p><p>通过让您构建高质量的web应用程序，了解NodeJS会给您带来一份工作或改善您当前的工作。</p><p><br>在本课程中，您将深入了解Node，了解NodeJS如何在底层工作，以及这些知识如何帮助您避免常见的陷阱，并显著提高您调试问题的能力。</p><p>在本课程中，我们将了解c++编写的V8 Javascript引擎如何工作，以及NodeJS如何使用它来扩展Javascript的能力。</p><p>您将学习如何构造代码以供重用，以及如何更容易地理解、管理和扩展使用模块，以及如何真正理解模块的工作方式。</p><p>我们将看到如何在Node中构建web服务器。</p><p>我们将使用Express深入到web站点、web应用程序和api中，并学习如何作为Node&nbsp;开发人员节省时间。</p><p><br>在此期间，您将深入了解Javascript概念和power Node的其他计算机科学概念。<br><br></p><p>NodeJS并不难学。大多数编码教程所犯的最大错误是期望有人仅仅通过模仿别人的代码来学习。</p><p>我认为最好的学习方法是了解一个工具是如何工作的，它对你有什么帮助，看一些例子，然后自己去尝试。</p><p>这就是本课程的构建方式，目的是帮助您学习和理解NodeJS。</p>',
