																												   'How to make games in Unreal Engine 5!C++, the games industry standard language!Object Oriented Programming and how to put it into practice!Game design principles!Programming patterns and best practices!Artificial Intelligence behaviour programming for enemies',
																													'64-bit PC capable of running Unreal 5 (recommended) or a Mac running latest MacOS Big Sur!DirectX 11, 12 or Metal 1.2 Compatible Graphics Card',
																													'<p>Ready to&nbsp;<strong>make games in the amazing world of Unreal Engine 5</strong>?</p><p>This<strong>&nbsp;</strong>&quot;<strong>critically-acclaimed</strong>&quot; and &quot;<strong>insanely successful</strong>&quot; Unreal Engine course<strong>&nbsp;</strong>was<strong>&nbsp;created in collaboration with Epic Games.</strong></p><p><strong>The majority of the course has been fully updated and remastered to Unreal Engine 5.&nbsp;</strong>Existing students get all the new material for free.</p><p><strong>Learn how to create and mod video games using Unreal Engine 5</strong>, even if you&apos;re a complete beginner. Unreal is a free-to-use game development engine used by AAA studios and indie developers worldwide. It is a massive and powerful beast, but&nbsp;<strong>we break it down step-by-step</strong> so you can tame it.</p><p>We start super simple so&nbsp;<strong>no prior experience of Unreal or coding is needed</strong>! With our online tutorials, you&apos;ll be amazed at what you can achieve. We believe project-based learning is the best way to learn Unreal Engine, so you&rsquo;ll create 5 Unreal games!</p><p>Already know Unreal and want to learn VR&nbsp;or Multiplayer? Check out our other Unreal courses, just&nbsp;<strong>look for the green leaf&nbsp;</strong>for our other world-class Unreal courses.</p><p><strong>Learn C++, the powerful industry-standard language from scratch</strong>. By the end of the course, you&apos;ll be very confident in the basics of coding and game development, and hungry to learn more.</p>',
																												   4.6,
																												   5,
																												   'Beginner',
																												   39.99,
																												   9,
																												   null,
																													'English',
																													'Published');
Insert into CP_COURSE (ID,NAME,INSTRUCTOR_ID,OVERVIEW,LEARNING_OUTCOMES,PREREQUISITES,DESCRIPTION,RATING,CATEGORY_ID,LEVEL,PRICE,IMAGE_ID,DISCOUNT,LANGUAGE,STATUS) values (10,
																												   'Aprenda e Domine a Linguagem C',
																												   11,
																												   'CURSO PRÁTICO de Desenvolvimento de programas. Aprenda e domine a programação de computadores usando a Linguagem C',
																												   'Dominar as técnicas básicas da programação de computadores com o uso da Linguagem C!Aprenda e domine a Linguagem C de forma prática, usando muitos exercícios, que irão apresentar a estrutura da programação estruturada com a Linguagem C. CURSO!Usar o raciocínio lógico aplicado na linguagem C!A Linguagem C está na maioria das Universidades brasileiras e estrangeiras, e nos cursos como Engenharia da Computação',
																													'Não há nenhum tipo de software ou pré-requisito para fazer este curso, tudo o que for necessário o instrutor mostrará como fazer download gratuito. Não será necessário comprar qualquer software para desenvolver os exercícios do curso.!O Instrutor ficará a disposição para dúvidas que vierem a ocorrer no curso. Você poderá enviar sua dúvida e o instrutor irá gravar uma resposta para você.',
																													'<p>Aprenda e Domine Uma Das Mais Populares Linguagens de programa&ccedil;&atilde;o:&nbsp;<strong><em>&ldquo;A Linguagem C&rdquo;</em></strong>.</p><p>Se voc&ecirc; &eacute; estudante de um curso universit&aacute;rio ou curso t&eacute;cnico e est&aacute; tendo dificuldades com&nbsp;<strong>Algoritmos</strong> <strong>e&nbsp;</strong><strong>L&oacute;gica de programa&ccedil;&atilde;o</strong> e&nbsp;com o&nbsp;<strong>Desenvolvimento de programas em linguagem&nbsp;</strong><strong><em>&ldquo;C&rdquo;</em></strong>, deve come&ccedil;ar por este curso para aprender e dominar a&nbsp;<strong><em>Linguagem C</em></strong>.</p><p>Se voc&ecirc; quer&nbsp;<strong>aprender&nbsp;a programar computadores</strong> este curso &eacute; ideal para voc&ecirc;, porque vamos estudar as t&eacute;cnicas b&aacute;sicas de como fazer programas de computadores estruturados e l&oacute;gicos.</p><p>Este curso vai introduzi-lo no mundo da&nbsp;<strong>programa&ccedil;&atilde;o estruturada</strong>, de forma r&aacute;pida e f&aacute;cil.</p><p>Em um curso com muitos exerc&iacute;cios pr&aacute;ticos, acompanhados pelo professor, voc&ecirc; vai colocar a&nbsp;<strong><em>&quot;m&atilde;o-na-massa&quot;</em></strong> e programar na&nbsp;<strong>Linguagem C</strong> em apenas 7 se&ccedil;&otilde;es.</p><p>Voc&ecirc; vai come&ccedil;ar a romper as barreiras da programa&ccedil;&atilde;o, com um futuro promissor como&nbsp;<strong>programador de computadores</strong>.</p><p>Todo programador precisa de algumas t&eacute;cnicas b&aacute;sicas, aqui voc&ecirc; vai ser introduzido a conhecer e trabalhar com elas.</p><p>Neste curso resolvemos juntos problemas com&nbsp;<strong>Entrada e Sa&iacute;da de Dados</strong>,&nbsp;<strong>Desvios Condicionais</strong> e&nbsp;<strong>La&ccedil;os de Repeti&ccedil;&atilde;o</strong>.</p><p>Projetei este curso de programa&ccedil;&atilde;o para que&nbsp;<strong>fosse facilmente compreendido por&nbsp;alunos&nbsp;iniciantes,</strong>&nbsp; para aqueles que&nbsp;<strong>tem dificuldades com a programa&ccedil;&atilde;o&nbsp;de computadores</strong> e tamb&eacute;m para aqueles&nbsp;<strong>q</strong><strong>ue desejam aprender a programar computadores na Linguagem C</strong>.</p>',
																												   4.9,
																												   7,
																												   'All level',
																												   29.99,
																												   10,
																												   null,
																													'Spanish',
																													'Published');
