																												   'The Ultimate Comprehensive Course - Perfect for Both Beginners and Experienced Developers',
																												   'The ultimate comprehensive course!For beginners and experienced devs!Taught by a university professor!From beginning to advanced concepts!Concurrency, channels, benchmarking!Testing, error handling, documentation',
																													'No prerequisite knowledge is required to take this course. This course starts at the very beginning and will teach you everything you need to know to be an outstanding programmer.',
																													'<p>This course is&nbsp;<strong>the ultimate comprehensive resource&nbsp;</strong>for learning the Go Programming Language.</p><p>This course is&nbsp;<strong>perfect</strong> <strong>for both beginners and experienced developers.</strong> The course is full of examples, hands-on exercises, solutions to the hands-on exercises, and an amazing code repository.</p><p>This course is taught by one of the world&apos;s leading Go Programming Trainers, Todd McLeod. Todd was the first&nbsp;<strong>university professor</strong> in America to teach Go at the university level. Todd has taught over&nbsp;<strong>3.25 Million students</strong> how to use the Go Programming Language. This&nbsp;<strong>course is tried, tested, and proven</strong> to train beginners and experienced developers how to use Go.&nbsp;</p><p>This course has a tremendous amount of content and resources so that you can&nbsp;<strong>learn everything you need to know</strong> - whatever is appropriate for your ability level.</p><p>When you enroll in this course, you will have<strong>&nbsp;lifetime access to the course.</strong> You will be able to&nbsp;<strong>learn at your own pace.</strong> You will always be able to come back to the content to review it, or learn additional concepts when you are ready for them.</p><p>This course also comes with a&nbsp;<strong>100% Satisfaction Money Back Guarantee.</strong></p><p>I&nbsp;know that this is absolutely the best course in the entire world for learning the Go Programming Language.</p><p>I know that you are going to be completely satisfied with the course.</p><p>And, if for any reason the course does not work for you, then within the first 14 days, you can receive a full refund.</p><p><strong>So enroll now!</strong></p>',
