																															 '5414790221',
																															 'GameDev.tv Founder :: Entrepreneur :: Passionate Teacher',
																															 'Hi, I''m Ben. I have a degree in computing from Imperial College London, and a physics diploma from the Open University. I started working for myself at the age of 15, and never looked back. I explored careers as varied as being a commercial pilot, stunt-man, rock climbing instructor, and more. None of these provided a continued challenge, and stable income in the same way technology does. After building and selling a home computer support business, I became an angel investor and business mentor here in Cambridge UK. I fell in love with teaching game development through one of my investments, and I now spend all of my time sharing my passion with people like you. I can''t wait to help you experience the fulfilment, and financial freedom, that having a deep understanding of technology brings. So why not start learning to make games with me and my team now?See you soon! ',
																															 'https://www.gamedev.tv/',
																															 9,
																															 10,
																															 null);
