Insert into CP_REVIEW (ID,COURSE_ID,USER_ID,RATING, CONTENT,CREATE_TIME,UPDATE_TIME) values (1,1, 2, 5,'It almost like having someone pour out an under-the-carpet knowledge in full. Angela does it for the best of her students. Someone I would be proud to verbalize as my python instructor anywhere, anytime.','2022-02-24 13:56:20.00 PDT',null);
Insert into CP_REVIEW (ID,COURSE_ID,USER_ID,RATING, CONTENT,CREATE_TIME,UPDATE_TIME) values (2,1, 3, 5,'I was zero in Python and started this course. Angela is a really good tutor as well as a guide. You will feel awesome and confident after completing this course.','2022-02-24 13:56:20.00 PDT',null);
Insert into CP_REVIEW (ID,COURSE_ID,USER_ID,RATING, CONTENT,CREATE_TIME,UPDATE_TIME) values (3,1, 4, 4,'Pity the old html videos seem to have been taken down. In my opinion they were better, especially the html personal website videos. Can these be put back up?','2022-02-24 13:56:20.00 PDT',null);
Insert into CP_REVIEW (ID,COURSE_ID,USER_ID,RATING, CONTENT,CREATE_TIME,UPDATE_TIME) values (4,2, 1, 5,'Maybe there could have been videos for the projects too since the documentation of few websites are too old. Rest all were just too good','2022-02-24 13:56:20.00 PDT',null);
Insert into CP_REVIEW (ID,COURSE_ID,USER_ID,RATING, CONTENT,CREATE_TIME,UPDATE_TIME) values (5,2, 5, 4,'One thing this course could use is EDITING, because there''s a lot of unnecessary things (i.e creating the project folder over over again for each project.).','2022-02-24 13:56:20.00 PDT',null);
Insert into CP_REVIEW (ID,COURSE_ID,USER_ID,RATING, CONTENT,CREATE_TIME,UPDATE_TIME) values (6,2, 2, 4,'I want typeScript included','2022-02-24 13:56:20.00 PDT',null);
Insert into CP_REVIEW (ID,COURSE_ID,USER_ID,RATING, CONTENT,CREATE_TIME,UPDATE_TIME) values (7,3, 3, 5,'The best teacher in the world. The courses are detailed with lots of examples and ways of thinking','2022-02-24 13:56:20.00 PDT',null);
Insert into CP_REVIEW (ID,COURSE_ID,USER_ID,RATING, CONTENT,CREATE_TIME,UPDATE_TIME) values (8,3, 7, 5,'Fantastic course, was a breakthrough in my coding journey and after completing this course it''s made me excited to keep learning and applying the knowledge. Thank you!','2022-02-24 13:56:20.00 PDT',null);
Insert into CP_REVIEW (ID,COURSE_ID,USER_ID,RATING, CONTENT,CREATE_TIME,UPDATE_TIME) values (9,4, 5, 5,'Very detailed course and had fun doing the projects','2022-02-24 13:56:20.00 PDT',null);
Insert into CP_REVIEW (ID,COURSE_ID,USER_ID,RATING, CONTENT,CREATE_TIME,UPDATE_TIME) values (10,4, 2, 3,'When it comes to basic, it was clear. But once the complicated topics are involved, we were focused on creating only the project rather understanding the concept.','2022-02-24 13:56:20.00 PDT',null);
Insert into CP_REVIEW (ID,COURSE_ID,USER_ID,RATING, CONTENT,CREATE_TIME,UPDATE_TIME) values (11,5, 2, 3,'The course is short but feels too long. There are a lot of videos that are very short. I am not getting the sense of accomplistment that you would get normally.','2022-02-24 13:56:20.00 PDT',null);
Insert into CP_REVIEW (ID,COURSE_ID,USER_ID,RATING, CONTENT,CREATE_TIME,UPDATE_TIME) values (12,5, 4, 5,'Great way of explaining important concepts to thrives out there in the market. Concise and clear on the explanations, short on the theoretical and persisting on the practical.I enjoyed learn a new programming language with this course.','2022-02-24 13:56:20.00 PDT',null);
Insert into CP_REVIEW (ID,COURSE_ID,USER_ID,RATING, CONTENT,CREATE_TIME,UPDATE_TIME) values (13,5, 3, 4,'This is one of the most interesting yet informative courses I have done! Lectures were made easy to follow even if you do not have a course background.','2022-02-24 13:56:20.00 PDT',null);
Insert into CP_REVIEW (ID,COURSE_ID,USER_ID,RATING, CONTENT,CREATE_TIME,UPDATE_TIME) values (14,6, 2, 5,'Most of the things are well explained. This course is good for a start in Machine Learning.','2022-05-22 13:56:20.00 PDT',null);
Insert into CP_REVIEW (ID,COURSE_ID,USER_ID,RATING, CONTENT,CREATE_TIME,UPDATE_TIME) values (15,6, 1, 4,'Highly recommended! Personally, the only handicap I find is that it is outdated, but the basic principles on which it is based to operate with Jenkins remain the same and are replicable on a current version.','2022-02-24 13:56:20.00 PDT',null);
Insert into CP_REVIEW (ID,COURSE_ID,USER_ID,RATING, CONTENT,CREATE_TIME,UPDATE_TIME) values (16,7, 5, 3,'Was struggling with Digital Ocean, at least try to instruct on alternatives you mentioned for how to use docker without Digital Ocean, don''t just refer them.','2022-02-24 13:56:20.00 PDT',null);
Insert into CP_REVIEW (ID,COURSE_ID,USER_ID,RATING, CONTENT,CREATE_TIME,UPDATE_TIME) values (17,7, 2, 5,'This course actually gets down to details that the other CI/CD course that I took did not. It covered Jenkins and Blue Ocean, Gradle, Git, Java, SSH-Agent, Artifactory, and Security. I highly recommend this course.','2022-02-24 13:56:20.00 PDT',null);
Insert into CP_REVIEW (ID,COURSE_ID,USER_ID,RATING, CONTENT,CREATE_TIME,UPDATE_TIME) values (18,8, 2, 5,'太感謝你發的這一系列的影片  我真的受益良多阿!!另外有個小小建議:影片標題可以標註一下集數，Youtube自動撥放下一集萬一跳號了比較好發現唷','2022-02-24 13:56:20.00 PDT',null);
Insert into CP_REVIEW (ID,COURSE_ID,USER_ID,RATING, CONTENT,CREATE_TIME,UPDATE_TIME) values (19,8, 4, 4,'很喜歡你的影片，學會了，本來還想不到學啥，看了你的影片就想學','2022-05-14 13:56:20.00 PDT',null);
Insert into CP_REVIEW (ID,COURSE_ID,USER_ID,RATING, CONTENT,CREATE_TIME,UPDATE_TIME) values (20,8, 3, 5,'謝謝影片超讚!在搜索框內可以輸入跳出視窗好神啊😮','2022-02-24 13:56:20.00 PDT',null);
Insert into CP_REVIEW (ID,COURSE_ID,USER_ID,RATING, CONTENT,CREATE_TIME,UPDATE_TIME) values (21,9, 4, 3,'Great course, but not all were in unreal engine 5 and the teacher for the simple shooter game was taught quickly which lead me to have difficulty following.','2022-02-24 13:56:20.00 PDT',null);
Insert into CP_REVIEW (ID,COURSE_ID,USER_ID,RATING, CONTENT,CREATE_TIME,UPDATE_TIME) values (22,9, 2, 5,'I could not write anything down, because I had just started at the time of reviewing. I''m on section 03, lesson 59 now. I already know C/C++, but I''m completely new to UE and I can say the course is really cool for all levels. Mike, the instructor for the Bull Cows section, seems to be a really nice guy to chat with and catch up! Congratulations!','2022-02-24 13:56:20.00 PDT',null);
